import React, { Component } from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    NavbarText,
    Button
  } from 'reactstrap';

class Header extends Component {
    render() {
        return(
            <div>
                <Navbar dark expand="md">
                    <NavbarBrand className="mr-auto" href="/"><img src='assets\pixil-frame-0.png' height="60" width="60" alt='Safve' /></NavbarBrand>
                    <Nav navbar>
                        <NavItem>
                            <NavLink className="nav-link" to='/'><span className="fa fa-home fa-lg">Home</span></NavLink>
                        </NavItem>
                    </Nav>
                </Navbar>
            </div>
                )
    }
}

export default Header;
